css:
.header__logo {
    max-width: 300px;
    max-height: 100px;
}
.header__nav {
    text-align: center;font-weight: 500;
  font-size: 1.1rem;font-family: 'Roboto', sans-serif;}
.header__nav a:hover {
    background: transparent;color: #f02083;
    text-decoration: none;font-weight: 500;
}
a {
    color: #375159;
    text-decoration: none;
}
.header__buttons .btn{color: #3897d0;}
.badge-primary {
    color: #fff;
    background-color: #f02083;
}.menu {

  background: #d2e3e3;}
.menu__item:hover {
    text-decoration: none;
    background: #d2e3e3;color: #e82b8b;font-family: 'Roboto', sans-serif;
  font-size: 1.1rem;}
.menu__item {
    text-decoration: none;
    background: #d2e3e3;color:#3b4257;font-family: 'Roboto', sans-serif;
  font-size: 1.1rem;}
.menu__item {
    border-bottom: var(--border-width) solid #d2e3e3;

}
.menu__footer a {
    color: #273744;
    text-decoration: none;font-family: 'Roboto', sans-serif;
}
.top-bar__page-links a {
    font-weight: 500;font-family: 'Roboto', sans-serif; font-size: 0.9rem;
}
